export function SwedenMap({ selectedStation, onStationSelect }: SwedenMapProps) {
  const selectedCoords = STATION_COORDS[selectedStation];
  const [zoom, setZoom] = useState(1);
  const [pan, setPan] = useState({ x: 0, y: 0 });
  const [isDragging, setIsDragging] = useState(false);
  const [dragStart, setDragStart] = useState({ x: 0, y: 0 });
  const svgRef = useRef<SVGSVGElement>(null);
  const containerRef = useRef<HTMLDivElement>(null);

  // Prevent page scroll when scrolling on the map
  useEffect(() => {
    const container = containerRef.current;
    if (!container) return;
    
    const preventScroll = (e: WheelEvent) => {
      e.preventDefault();
    };
    
    container.addEventListener('wheel', preventScroll, { passive: false });
    return () => container.removeEventListener('wheel', preventScroll);
  }, []);

  const handleZoomIn = () => setZoom(z => Math.min(z + 0.3, 3));
  const handleZoomOut = () => {
    const newZoom = Math.max(zoom - 0.3, 1);
    setZoom(newZoom);
    if (newZoom <= 1) setPan({ x: 0, y: 0 });
  };
  const handleReset = () => {
    setZoom(1);
    setPan({ x: 0, y: 0 });
  };

  // Mouse/touch handlers for panning
  const handleMouseDown = useCallback((e: React.MouseEvent) => {
    if (zoom > 1) {
      setIsDragging(true);
      setDragStart({ x: e.clientX, y: e.clientY });
    }
  }, [zoom]);

  const handleMouseMove = useCallback((e: React.MouseEvent) => {
    if (isDragging && zoom > 1) {
      const dx = (e.clientX - dragStart.x) / zoom;
      const dy = (e.clientY - dragStart.y) / zoom;
      
      // Calculate pan boundaries based on zoom level
      // Sweden roughly occupies x: 300-650, y: 100-970 in the 1000x1000 viewBox
      const viewSize = 1000 / zoom;
      const halfView = viewSize / 2;
      
      // Map center is roughly at (475, 535)
      const mapCenterX = 475;
      const mapCenterY = 535;
      
      // Allow panning so the view stays mostly over the map
      const minPanX = -(650 - halfView - (500 - mapCenterX));
      const maxPanX = (500 - 300 + halfView - (500 - mapCenterX));
      const minPanY = -(970 - halfView - (500 - mapCenterY));
      const maxPanY = (500 - 100 + halfView - (500 - mapCenterY));
      
      const newPanX = Math.max(minPanX, Math.min(maxPanX, pan.x - dx));
      const newPanY = Math.max(minPanY, Math.min(maxPanY, pan.y - dy));
      
      setPan({ x: newPanX, y: newPanY });
      setDragStart({ x: e.clientX, y: e.clientY });
    }
  }, [isDragging, zoom, dragStart, pan]);

  const handleMouseUp = useCallback(() => {
    setIsDragging(false);
  }, []);

  const handleMouseLeave = useCallback(() => {
    setIsDragging(false);
  }, []);

  // Handle wheel zoom - zoom towards cursor position
  const handleWheel = useCallback((e: React.WheelEvent) => {
    e.preventDefault();
    
    const svg = svgRef.current;
    if (!svg) return;
    
    const rect = svg.getBoundingClientRect();
    // Get cursor position relative to SVG (0-1)
    const cursorX = (e.clientX - rect.left) / rect.width;
    const cursorY = (e.clientY - rect.top) / rect.height;
    
    const oldZoom = zoom;
    let newZoom: number;
    
    if (e.deltaY < 0) {
      newZoom = Math.min(oldZoom + 0.2, 3);
    } else {
      newZoom = Math.max(oldZoom - 0.2, 1);
    }
    
    if (newZoom <= 1) {
      setZoom(1);
      setPan({ x: 0, y: 0 });
      return;
    }
    
    // Calculate the point in SVG coordinates where cursor is
    const oldViewSize = 1000 / oldZoom;
    const oldViewX = (1000 - oldViewSize) / 2 + pan.x;
    const oldViewY = (1000 - oldViewSize) / 2 + pan.y;
    const svgCursorX = oldViewX + cursorX * oldViewSize;
    const svgCursorY = oldViewY + cursorY * oldViewSize;
    
    // Calculate new pan to keep cursor point stationary
    const newViewSize = 1000 / newZoom;
    const halfView = newViewSize / 2;
    let newPanX = svgCursorX - cursorX * newViewSize - (1000 - newViewSize) / 2;
    let newPanY = svgCursorY - cursorY * newViewSize - (1000 - newViewSize) / 2;
    
    // Apply boundary limits based on Sweden's position in the SVG
    const mapCenterX = 475;
    const mapCenterY = 535;
    const minPanX = -(650 - halfView - (500 - mapCenterX));
    const maxPanX = (500 - 300 + halfView - (500 - mapCenterX));
    const minPanY = -(970 - halfView - (500 - mapCenterY));
    const maxPanY = (500 - 100 + halfView - (500 - mapCenterY));
    
    newPanX = Math.max(minPanX, Math.min(maxPanX, newPanX));
    newPanY = Math.max(minPanY, Math.min(maxPanY, newPanY));
    
    setZoom(newZoom);
    setPan({ x: newPanX, y: newPanY });
  }, [zoom, pan]);

  // Calculate viewBox based on zoom and pan
  const baseSize = 1000;
  const viewSize = baseSize / zoom;
  const viewX = (baseSize - viewSize) / 2 + pan.x;
  const viewY = (baseSize - viewSize) / 2 + pan.y;

  return (
    <div ref={containerRef} className="relative h-[520px]">
      {/* Zoom Controls */}
      <div className="absolute top-2 right-2 z-10 flex flex-col gap-1">
        <button
          onClick={handleZoomIn}
          className="w-8 h-8 bg-white border border-gray-300 rounded-md shadow-sm hover:bg-gray-50 flex items-center justify-center text-gray-600 font-bold"
          title="Zoom in"
        >
          +
        </button>
        <button
          onClick={handleZoomOut}
          className="w-8 h-8 bg-white border border-gray-300 rounded-md shadow-sm hover:bg-gray-50 flex items-center justify-center text-gray-600 font-bold"
          title="Zoom out"
        >
          −
        </button>
        <button
          onClick={handleReset}
          className="w-8 h-8 bg-white border border-gray-300 rounded-md shadow-sm hover:bg-gray-50 flex items-center justify-center text-gray-500 text-xs"
          title="Reset view"
        >
          ↺
        </button>
      </div>

      {/* Zoom hint - bottom center */}
      {zoom < 1.4 && (
        <div className="absolute bottom-2 left-1/2 -translate-x-1/2 z-10 text-xs text-gray-400 bg-white/80 px-2 py-1 rounded whitespace-nowrap">
          {zoom === 1 ? "Numbers show station count • Zoom in to see all" : "Scroll to zoom • Drag to pan"}
        </div>
      )}

      <svg 
        ref={svgRef}
        viewBox={`${viewX} ${viewY} ${viewSize} ${viewSize}`} 
        className={`w-full h-[500px] ${zoom > 1 ? 'cursor-grab' : ''} ${isDragging ? 'cursor-grabbing' : ''}`}
        xmlns="http://www.w3.org/2000/svg"
        style={{ touchAction: 'none' }}
        onMouseDown={handleMouseDown}
        onMouseMove={handleMouseMove}
        onMouseUp={handleMouseUp}
        onMouseLeave={handleMouseLeave}
        onWheel={(e) => {
          e.stopPropagation();
          handleWheel(e);
        }}
      >
        {/* County boundaries */}
        <g id="counties">
          {COUNTY_PATHS.map((county) => (
            <path
              key={county.id}
              d={county.d}
              fill="#ffedd5"
              stroke="#a1a1aa"
              strokeWidth="1.2"
              className="transition-colors hover:fill-orange-200"
            >
              <title>{county.name}</title>
            </path>
          ))}
        </g>

        {/* Station markers - show clusters when zoomed out, individual when zoomed in */}
        {zoom < 1.4 ? (
          // CLUSTERED VIEW - group by county, show numbers on all
          <>
            {(() => {
              // Group stations by county
              const countyClusters: Record<string, { stations: string[]; x: number; y: number }> = {};
              Object.entries(STATION_COORDS).forEach(([id, coords]) => {
                if (!countyClusters[coords.county]) {
                  countyClusters[coords.county] = { stations: [], x: 0, y: 0 };
                }
                countyClusters[coords.county].stations.push(id);
                countyClusters[coords.county].x += coords.x;
                countyClusters[coords.county].y += coords.y;
              });
              // Calculate center of each cluster
              Object.values(countyClusters).forEach(cluster => {
                cluster.x = cluster.x / cluster.stations.length;
                cluster.y = cluster.y / cluster.stations.length;
              });

              return Object.entries(countyClusters).map(([county, cluster]) => {
                const isSelectedInCluster = cluster.stations.includes(selectedStation || "");
                const count = cluster.stations.length;
                const radius = Math.min(22, 14 + count * 1.2);
                
                return (
                  <g key={county} className="cursor-pointer" onClick={() => setZoom(1.8)}>
                    <circle
                      cx={cluster.x}
                      cy={cluster.y}
                      r={radius + 4}
                      fill="transparent"
                    >
                      <title>{county}: {count} station{count > 1 ? 's' : ''} (click to zoom)</title>
                    </circle>
                    <circle
                      cx={cluster.x}
                      cy={cluster.y}
                      r={radius}
                      fill={isSelectedInCluster ? "#f97316" : "#78716c"}
                      stroke="white"
                      strokeWidth="2"
                      className="hover:fill-orange-500 transition-colors"
                    />
                    <text
                      x={cluster.x}
                      y={cluster.y + 1}
                      textAnchor="middle"
                      dominantBaseline="middle"
                      fill="white"
                      fontSize="16"
                      fontWeight="bold"
                      className="pointer-events-none select-none"
                    >
                      {count}
                    </text>
                  </g>
                );
              });
            })()}
          </>
        ) : (
          // INDIVIDUAL VIEW - show all stations
          Object.entries(STATION_COORDS).map(([id, coords]) => {
            const isSelected = id === selectedStation;
            return (
              <g key={id} className="cursor-pointer group" onClick={() => onStationSelect?.(id)}>
                <circle
                  cx={coords.x}
                  cy={coords.y}
                  r="12"
                  fill="transparent"
                >
                  <title>{getStationDisplayName(id)}</title>
                </circle>
                {!isSelected && (
                  <circle
                    cx={coords.x}
                    cy={coords.y}
                    r="4"
                    fill="#78716c"
                    stroke="white"
                    strokeWidth="1"
                    className="group-hover:fill-orange-500 transition-colors pointer-events-none"
                  />
                )}
              </g>
            );
          })
        )}

        {/* Selected station */}
        {selectedCoords && (
          <>
            <circle
              cx={selectedCoords.x}
              cy={selectedCoords.y}
              r="8"
              fill="none"
              stroke="#f97316"
              strokeWidth="2"
              opacity="0.3"
            >
              <animate attributeName="r" from="6" to="18" dur="1.5s" repeatCount="indefinite" />
              <animate attributeName="opacity" from="0.6" to="0" dur="1.5s" repeatCount="indefinite" />
            </circle>
            <circle
              cx={selectedCoords.x}
              cy={selectedCoords.y}
              r="6"
              fill="#f97316"
              stroke="#fff"
              strokeWidth="2"
            >
              <title>{getStationDisplayName(selectedStation)}</title>
            </circle>
          </>
        )}
      </svg>

      {selectedStation && (
        <div className="absolute bottom-2 left-2 bg-white/95 rounded-lg px-3 py-2 shadow-sm border border-gray-200">
          <div className="flex items-center gap-2">
            <div className="w-3 h-3 rounded-full bg-orange-500" />
            <span className="text-sm font-medium text-gray-700">{getStationDisplayName(selectedStation)}</span>
          </div>
        </div>
      )}
    </div>
  );
}
